  //             }
  //           },
  //           interactivity: {
  //             events: {
  //               onhover: {
  //                 enable: false,
  //                 mode: "repulse"
  //               }
  //             }
  //           }
  //         }}
  //       />
  //     </div>
  //   </div>
  // );
};

export default title;
